const addNewExpense = (props) => {
  const onSubmitHandler = (event) => {
    console.log(event);
    props.onAddNew(event);
  };

  return (
    <div className="new-expense">
      <button type="submit" onSubmit={onSubmitHandler}>
        Add New Expense
      </button>
    </div>
  );
};

export default addNewExpense;
